import PredictHit from "../PredictHit";
import PredictRevenue from "../PredictRevenue";
import MovieForm from "../MovieForm";

const MoviePrediction = () => {
  return (
    <>
      <MovieForm />
      <Box className={classes.predictionContainer}>
        <PredictHit />
        <PredictRevenue />
      </Box>
    </>
  );
};

export default MoviePrediction;
